import React ,{useState}from 'react'
import { Box,Accordion, AccordionSummary,AccordionDetails,Typography} from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
const ChatBox = () => {
    const [expanded, setExpanded] = useState(false);

    const handleAccordionClick = () => {
      setExpanded(!expanded);
    };

    return(
        <Box >
           <Accordion sx={{width:'15vw',minHeight: expanded ? '35px' : '35px'}}  onChange={handleAccordionClick}>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon sx={{color:'#fff'}} />}
          aria-controls="panel1a-content"
          id="panel1a-header"
          sx={{backgroundColor:'#00559A' , minHeight: '10px',height:'35px',color:'#fff',borderRadius:'5px',mb:.5}}
        >
          <Typography sx={{color:'#fff'}}>Chat Box</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
            malesuada lacus ex, sit amet blandit leo lobortis eget.
          </Typography>
        </AccordionDetails>
      </Accordion>
        </Box>
    )
}
export default ChatBox;
